import Data from '../data/data.json';
import Navbar from './Navbar';
import Product from './Product';
import Summer from '../images/products/summer-limited-edition-sneakers.jpg';

function App() {
  const renderedItems = Data.map(item => {

    return(
      <Product 
        key={item.id}
        imgUrl={`../images/products/${item.imageFile}`}
        name={item.name}
        description={item.description}
        price={item.price}
        discount={50}
      />
    )
  })


  return(
    <div>
      <Navbar />
      <Product image={Summer}/>
      <Product />
      <Product />
      <Product />
    </div>
  )
}

export default App;
